import React from "react";
import "./Header.css";
import AboutMe from "../AboutMe"


function Header() {
    return (
      <div className="header">
        <div className="title typewriter">
          <h1>Hi, I'm Michael!</h1>
          <h2>Software Engineer in NYC</h2>
        </div>
        <AboutMe></AboutMe>
      </div>

    );
  }

  export default Header;
